// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface IMortgageLoanContract {
    function ForwardedLoanApproved(address _userAddress, uint256 loanId,
        uint256 amount,
        string memory personalCID,
        string memory financialCID,
        address borrower,
        string memory loanType) external;

    function ForwardedLoanDenied(address _userAddress, 
        uint256 _loanId,
        uint256 _amount,
        string memory _personalCID,
        string memory _financialCID,
        address _borrower,
        string memory loanType
    ) external;
}

contract LoanContract {

    address public mortgageLoanContractAddress;

    constructor(address _mortgageLoanContractAddress) {
        mortgageLoanContractAddress = _mortgageLoanContractAddress;
    }

    struct Loan {
        uint256 loanId;
        uint256 amount;
        string personalCID;
        string financialCID;
        bool isApproved;
        bool isDenied;
        address borrower;
        string loanType;
    }

    mapping(uint256 => Loan) public loans;

    event LoanApproved(
        uint256 indexed loanId,
        uint256 amount,
        string personalCID,
        string financialCID,
        address borrower,
        string loanType
    );

    event LoanDenied(
        uint256 indexed loanId,
        uint256 amount,
        string personalCID,
        string financialCID,
        address borrower,
        string loanType
    );

    event AccessRequestGranted(address indexed requester, string cidType, string ipfsHash);

    function requestAccessGranted(address requester, string memory cidType, string memory ipfsHash) external {
        emit AccessRequestGranted(requester, cidType, ipfsHash);
    }

    function approveLoan(
        uint256 _loanId,
        uint256 _amount,
        string memory _personalCID,
        string memory _financialCID,
        address _borrower,
        string memory loanType
    ) external {
        require(!loans[_loanId].isApproved && !loans[_loanId].isDenied, "Loan already processed");
        
        // Store loan details
        loans[_loanId] = Loan({
            loanId: _loanId,
            amount: _amount,
            personalCID: _personalCID,
            financialCID: _financialCID,
            isApproved: true,
            isDenied: false,
            borrower: _borrower,
            loanType: loanType
        });

        if(keccak256(abi.encodePacked(loanType)) == keccak256(abi.encodePacked("forwarded"))) {
            IMortgageLoanContract(mortgageLoanContractAddress).ForwardedLoanApproved(mortgageLoanContractAddress, _loanId,_amount, _personalCID, _financialCID, _borrower, loanType);
        }
        else{
            // Emit approval event
            emit LoanApproved(
                _loanId,
                _amount,
                _personalCID,
                _financialCID,
                _borrower,
                loanType
            );
        }
        
    }

    function denyLoan(
        uint256 _loanId,
        uint256 _amount,
        string memory _personalCID,
        string memory _financialCID,
        address _borrower,
        string memory loanType
    ) external {
        require(!loans[_loanId].isApproved && !loans[_loanId].isDenied, "Loan already processed");
        
        // Store loan details
        loans[_loanId] = Loan({
            loanId: _loanId,
            amount: _amount,
            personalCID: _personalCID,
            financialCID: _financialCID,
            isApproved: false,
            isDenied: true,
            borrower: _borrower,
            loanType: loanType
        });

        if(keccak256(abi.encodePacked(loanType)) == keccak256(abi.encodePacked("forwarded"))) {
            IMortgageLoanContract(mortgageLoanContractAddress).ForwardedLoanDenied(mortgageLoanContractAddress, _loanId,_amount, _personalCID, _financialCID, _borrower, loanType);
        }
        else{

            // Emit denial event
            emit LoanDenied(
                _loanId,
                _amount,
                _personalCID,
                _financialCID,
                _borrower,
                loanType
            );
        }
    }

    // Function to get loan details
    function getLoanDetails(uint256 _loanId) external view returns (
        uint256 amount,
        string memory personalCID,
        string memory financialCID,
        bool isApproved,
        bool isDenied,
        address borrower,
        string memory loanType
    ) {
        Loan memory loan = loans[_loanId];
        return (
            loan.amount,
            loan.personalCID,
            loan.financialCID,
            loan.isApproved,
            loan.isDenied,
            loan.borrower,
            loan.loanType
        );
    }
}

contracts/MortgageContract.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface IAccessControl {
    function requestAccess(address requester, string memory cidType, string memory ipfsHash) external;
}

contract MortgageContract {
    address public accessControlContractAddress;
    address public owner;

    event AccessRequestedByMortgage(address indexed requester, string personalIpfsHash, string financialIpfsHash);

    constructor(address _accessControlAddress) {
        accessControlContractAddress = _accessControlAddress;
        owner = msg.sender;
    }

    function requestUserAccess(address _userAddress, string memory _personalIpfsHash, string memory _financialIpfsHash) public {
        // Interact with the deployed AccessControl contract
        IAccessControl(accessControlContractAddress).requestAccess(_userAddress, "personal", _personalIpfsHash);
        IAccessControl(accessControlContractAddress).requestAccess(_userAddress, "financial", _financialIpfsHash);

        emit AccessRequestedByMortgage(_userAddress, _personalIpfsHash, _financialIpfsHash);
    }

}

